import { useNavigate } from "react-router-dom";
import "./ArrowBack.css";

const ArrowBack = () =>{
    const history = useNavigate();

    const handleBackClick = () => {
        history(-1);
    };

    return(
        <div className="arrow-back-container" onClick={handleBackClick}>
            <div className="arrow-back">
